import type { AppProps } from "next/app";
import "../styles/globals.css";

export default function App({ Component, pageProps }: AppProps) {
  return (
    <div>
      <div>
        <h1 className="text-3xl">Nesbru Kebab</h1>
        <ul>
          <li>Hjem</li>
          <li>Om oss</li>
          <li>Tilbud</li>
          <li>Meny</li>
          <li>Kontakt oss</li>
        </ul>
      </div>
    </div>
  );
}
